import React, { Component } from 'react';

export default class Countdown extends Component {
    render() {
        const events = require("../countdown-list.json");
        return (
            <div>
                {events.map(event => {
                    <div>
                        <h1>{event.title}</h1>
                        <h2>{event.month}/{event.day}/{event.year}</h2>
                    </div>
                })
                }
                <h1>Countdown!</h1>
            </div>
        )
    }
}
